ISLAMABAD, Feb 16 (APP): Adviser to prime minister on Commerce Abdul Razak Dawood called on Prime Minister Imran Khan here on Tuesday and briefed him about the trade potential existing between Pakistan and Uzbekistan.
The Commerce Adviser apprised the Prime Minister about his recent visit to the Central Asian state and gave a briefing about the prospects of bilateral trade.
